
USE master;
go
IF DB_ID('Aula') IS NOT NULL
BEGIN
    ALTER DATABASE Aula SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    DROP DATABASE Aula;
END
CREATE DATABASE Aula;
go
USE Aula;
go

CREATE TABLE Sala 
(
	IDSala VARCHAR(12) NOT NULL PRIMARY KEY,
	Nome VARCHAR(50) NOT NULL ,
	Capacidade INT NOT NULL
);
go
go

CREATE TABLE Evento (
	IDEvento VARCHAR(12) NOT NULL PRIMARY KEY,
	IDSala VARCHAR(12) NOT NULL FOREIGN KEY REFERENCES Sala(IDSala),
	Descricao VARCHAR(100) NOT NULL,
	DtHrInicio DATETIME NOT NULL,
	DtHrFim DATETIME NOT NULL
);
go
BEGIN TRANSACTION
IF @@ERROR <> 0
BEGIN
    ROLLBACK
END
ELSE
BEGIN
	COMMIT
END
go

CREATE TABLE Equipamento (
	IDEquipamento VARCHAR(12) NOT NULL PRIMARY KEY,
	IDSala VARCHAR(12) FOREIGN KEY REFERENCES Sala(IDSala),
	Nome VARCHAR(50) NOT NULL,
	Tipo VARCHAR(100)
);
go
go

CREATE TABLE Pessoa (
	IDPessoa VARCHAR(12) NOT NULL PRIMARY KEY,
	Nome VARCHAR(255) NOT NULL,
	Categoria VARCHAR(20) NOT NULL
);
go
go


CREATE TABLE EventoPessoa (
	IDEventoPessoa VARCHAR(12) NOT NULL PRIMARY KEY,
	IDEvento VARCHAR(12) NOT NULL FOREIGN KEY REFERENCES Evento(IDEvento),
	IDPessoa VARCHAR(12) NOT NULL FOREIGN KEY REFERENCES Pessoa(IDPessoa),
	PapelEvento VARCHAR(75) NOT NULL,
	Presenca BIT NOT NULL
);
go
go

CREATE TABLE EventoEquipamento (
	IDEventoEquipamento VARCHAR(12) NOT NULL PRIMARY KEY,
	IDEvento VARCHAR(12) NOT NULL FOREIGN KEY REFERENCES Evento(IDEvento),
	IDEquipamento VARCHAR(12) NOT NULL FOREIGN KEY REFERENCES Equipamento(IDEquipamento)
);
go
go



